import React, { Component } from "react";
import axios from "axios";
import './Login.css';

export default class Login extends Component {
  constructor(props) {
  }
  render() {
    return (
      <div className="r5">
        <center>
        <fieldset>
  <legend className="r9">Rwenzori Airlines Membership Log In Page</legend><br />
  <img src="https://www.pngitem.com/pimgs/m/111-1114675_user-login-person-man-enter-person-login-icon.png" className="r7" alt=""/>
       <br/>
        <form onSubmit={this.handleSubmit}>
          <label>Username/Email:</label><br />
          <input
            type="email"
            name="email"
            placeholder="Email"
            value={this.state.email}
            onChange={this.handleChange}
            required
          />
<br />
<label>Password:</label>
<br />
          <input
            type="password"
            name="password"
            placeholder="Password"
            value={this.state.password}
            onChange={this.handleChange}
            required
          />
<br />
<br />
<input className="btn btn-primary" type="submit" value="submit"></input><br />
        </form>
        </fieldset>
        </center>
      </div>
    );
  }
}
